/// SPDX-License-Identifier: UNLICENSED

pragma solidity 0.8.5;

/// @title Contract to agree on the lunch venue
/// @author Dilum Bandara , CSIRO’s Data61
/// Edited by: Amos Tan, UNSW (z5440950) to fix bugs as mentioned in Lab 01
///
/// @dev Bugs known:
/// 1. A friend can vote more than once. While this was handy in testing our contract, it is undesirable as one could monopolise the selected venue.
///    Ideally, we should record a vote for a given address only once.
///    - added `friends[msg.sender].voted == false` in doVote function to ensure the voter has not voted before
///
/// 2. The same restaurant and friend can be added multiple times leading to similar issues.
///    - enumerate existing restaurants and check if the restaurant already exists
///    - check if the friend's address already exists by checking if the name exists since doVote function checks if the friend's name exists before
///      allowing the friend to vote
///
/// 3. While the contract is stuck at the doVote function, other functions can still be called. Also, once the voting starts, new venues and friends
///    can be added, making the whole process chaotic. In a typical voting process, voters are clear about who would vote and what to vote on before
///    voting starts to prevent any disputes. Hence, a good vote process should have well-defined create, vote open, and vote close phases.
///    - added state variable to keep track of the state of the contract (Creating, Voting, Ended, Cancelled)
///    - added modifiers to restrict functions to be called only in certain states
///
/// 4. There is no way to disable the contract once it is deployed. Even the manager cannot do anything to stop the contract in case the team lunch
///    has to be cancelled.
///    - added cancelVoting function to allow the manager to cancel the contract
///
/// 5. Gas consumption is not optimised. More simple data structures may help to reduce transaction fees.
///    - added unchecked for incrementing variable i in for loops
///    - remove initialisation of variable of 0
///    - added immutable type for manager variable since it will not be modified after contract construction
///    - rearrange the order of state variables, state variable and address variable are placed together to use one slot.
///
/// Other comments:
/// The contract below follows Natspec format: https://docs.soliditylang.org/en/v0.8.20/natspec-format.html
/// along with the order of layout: https://docs.soliditylang.org/en/latest/style-guide.html#order-of-layout
///
/// To show the bugs are fixed
/// Contract Address: 0x02635535fD00449CcAB1d5961a2369B854Ae9A8A
///
/// Bug 1:
/// - Charlie tried to vote twice but it returns false for the second doVote function call.
///   https://sepolia.etherscan.io/tx/0xa67f15e27799e495d43ef740a678ebf52a8624498e0f2b02c1c33f938944a9bd
///
/// Bug 2:
/// - The same friend cannot be added multiple times.
///   https://sepolia.etherscan.io/tx/0x3712e476de603ed46801711e1365ac6acb3107df0535ab3a6b6a1b249b19b368
/// - The same restaurant cannot be added multiple times.
///   https://sepolia.etherscan.io/tx/0xe03c5a6c400fe60b1b423b4fa912ef8343435e306a9f399184d52f89bcf281b4
///
/// Bug 3:
/// - Bob tried to vote in the creating state but failed.
///   https://sepolia.etherscan.io/tx/0x85be85a6a8c20e08e3248c11f236db433d10314b8ce15ea8a83426f1a35f005b
/// - Bob tried to change the state of the contract from creating to voting but failed as he is not the manager.
///   https://sepolia.etherscan.io/tx/0x5ac030e060b6e29e822edc20e28c5ce16e79a19e91b0506f5113f14773360289
///
/// Bug 4 (using contract address 0xdCe03e7960870E43CC4EB603dfa3d4812DFAC0D4):
/// - Bob tried to cancel the voting but fails because he is not the manager.
///   https://sepolia.etherscan.io/tx/0x837b77ba72423421955cdeab6bd564c8077f0a6fc02350982b9acf0aaca70d1a
/// - Only Alice, the manager, can cancel the voting
///   https://sepolia.etherscan.io/tx/0xcdcbcbbbcd54b845c4c28a35d0a60b861a6d69f72eac7d3ee23b22a6ce37d73f

contract LunchVenueNew {
    struct Friend {
        string name;
        bool voted; //Vote state
    }

    struct Vote {
        address voterAddress;
        uint restaurant;
    }

    enum State {
        Creating,
        Voting,
        Ended,
        Cancelled
    }

    mapping(uint => string) public restaurants; //List of restaurants (restaurant no, name)
    mapping(address => Friend) public friends; //List of friends (address, Friend)
    uint public numRestaurants;
    uint public numFriends;
    uint public numVotes;
    address public immutable manager; //Contract manager
    State public state;
    string public votedRestaurant; //Where to have lunch
    mapping(uint => Vote) public votes; //List of votes (vote no, Vote)
    mapping(uint => uint) private _results; //List of vote counts (restaurant no, no of votes)

    error LunchVenue__OnlyManager();
    error LunchVenue__OnlyInCreatingState();
    error LunchVenue__OnlyInVotingState();
    error LunchVenue__RestaurantAlreadyExists();
    error LunchVenue__FriendAddressAlreadyExists();

    /**
     * @notice Only the manager can do
     */
    modifier restricted() {
        if (msg.sender != manager) revert LunchVenue__OnlyManager();
        _;
    }

    /**
     * @notice Only when for creating state
     */
    modifier creatingState() {
        if (state != State.Creating) revert LunchVenue__OnlyInCreatingState();
        _;
    }

    /**
     * @notice Only when for voting state
     */
    modifier votingState() {
        if (state != State.Voting) revert LunchVenue__OnlyInVotingState();
        _;
    }

    /**
     * @dev Set manager when contract starts
     */
    constructor() {
        manager = msg.sender; //Set contract creator as manager
        state = State.Creating; // Set current state of contract as creating
    }

    /**
     * @notice Add a new restaurant
     * @dev To simplify the code, duplication of restaurants isn’t checked
     *
     * @param name Restaurant name
     * @return Number of restaurants added so far
     */
    function addRestaurant(
        string memory name
    ) public restricted creatingState returns (uint) {
        // modification: check if restaurant already exists
        for (uint i = 1; i <= numRestaurants; ) {
            if (keccak256(bytes(restaurants[i])) == keccak256(bytes(name))) {
                revert LunchVenue__RestaurantAlreadyExists();
            }
            unchecked {
                ++i;
            }
        }
        numRestaurants++;
        restaurants[numRestaurants] = name;
        return numRestaurants;
    }

    /**
     * @notice Add a new friend to voter list
     * @dev To simplify the code duplication of friends is not checked
     *
     * @param friendAddress Friend’s account/address
     * @param name Friend ’s name
     * @return Number of friends added so far
     */
    function addFriend(
        address friendAddress,
        string memory name
    ) public restricted creatingState returns (uint) {
        // modification: check if friend already exists
        if (bytes(friends[friendAddress].name).length != 0) {
            revert LunchVenue__FriendAddressAlreadyExists();
        }
        Friend memory f;
        f.name = name;
        f.voted = false;
        friends[friendAddress] = f;
        numFriends++;
        return numFriends;
    }

    /**
    * @notice Vote for a restaurant
    * @dev To simplify the code duplicate votes by a friend is not checked 
    *
    * @param restaurant Restaurant number being voted
    * @return validVote Is the vote valid? A valid vote should be from a registered
                        friend to a registered restaurant
    */
    function doVote(
        uint restaurant
    ) public votingState returns (bool validVote) {
        validVote = false; //Is the vote valid?

        //Does friend exist?
        //modification: ensure the voter has not previously voted
        if (
            bytes(friends[msg.sender].name).length != 0 &&
            friends[msg.sender].voted == false
        ) {
            //Does restaurant exist?
            if (bytes(restaurants[restaurant]).length != 0) {
                validVote = true;
                friends[msg.sender].voted = true;
                Vote memory v;
                v.voterAddress = msg.sender;
                v.restaurant = restaurant;
                numVotes++;
                votes[numVotes] = v;
            }
        }

        if (numVotes >= numFriends / 2 + 1) {
            //Quorum is met
            finalResult();
        }

        return validVote;
    }

    /**
     * @notice Start the voting
     * @dev Only the manager can start the voting
     */
    function startVoting() public creatingState restricted {
        state = State.Voting;
    }

    /**
     * @notice Cancel the voting
     * @dev Only the manager can cancel the voting
     */
    function cancelVoting() public restricted {
        state = State.Cancelled;
    }

    /**
     * @notice Determine winner restaurant
     * @dev If top 2 restaurants have the same no of votes, result depends on vote order
     */
    function finalResult() private {
        uint highestVotes;
        uint highestRestaurant;
        for (uint i = 1; i <= numVotes; ) {
            //For each vote
            uint voteCount = 1;
            if (_results[votes[i].restaurant] > 0) {
                // Already start counting
                voteCount += _results[votes[i].restaurant];
            }
            _results[votes[i].restaurant] = voteCount;
            if (voteCount > highestVotes) {
                // New winner highestVotes = voteCount;
                highestRestaurant = votes[i].restaurant;
            }
            unchecked {
                ++i;
            }
        }
        votedRestaurant = restaurants[highestRestaurant]; //Chosen restaurant
        state = State.Ended; //Voting is now closed
    }
}

